    ctx.strokeStyle = "#676565";
    ctx.lineWidth = 1;
	ctx.moveTo(0, Oy);
    ctx.lineTo(w, Oy);
    ctx.stroke();
	var ctxLine1 = getById.getContext("2d");
	ctxLine1.beginPath();
	ctxLine1.strokeStyle = "#676565";
	ctxLine1.lineWidth=2;
	ctxLine1.moveTo(Ox - 5,15);
	ctxLine1.lineTo(Ox,0);
	ctxLine1.moveTo(Ox + 5,15);
	ctxLine1.lineTo(Ox,0);
	ctxLine1.stroke();
